import React from "react";

export default function Comment() {
  return <div></div>;
}

Comment.getInitialProps = async () => {
  const post = await axios.get(
    "https://jsonplaceholder.typicode.com/posts/2/comments"
  );
  const { data } = post;
  return { post: data };
};
